  return (
    <div>
      <h2>Admin Dashboard</h2>
      <ul>
        <li><Link to="/admin/customers">View All Customers</Link></li>
        <li><Link to="/admin/summary">View Overall Summary</Link></li>
        {/* Add more links as features grow */}
      </ul>
    </div>
  );
}
